import 'package:http/http.dart' as http;

class Forget_Password extends StatefulWidget {
  static const String idScreen = "Forget_Password";
  const Forget_Password({Key? key}) : super(key: key);

  @override
  _Forget_PasswordState createState() => _Forget_PasswordState();
}

class _Forget_PasswordState extends State<Forget_Password> {
  String email = "";
  bool isSpin = false;

  Future forgotPassword() async {
    setState(() {
      isSpin = true;
    });
    // var urrr = Uri.parse('http://10.0.2.2/myjobscenter/demo/mob_login');
    var urrr = Uri.parse(defaultUrl + 'mob_forgot_email');

    // Store all data with Param Name.
    var data = {'email': email};

    // Starting Web API Call.
    var response = await http.post(urrr, body: json.encode(data));

    // Getting Server response into variable.
    print(response.body.toString());
    print(response.statusCode.toString());
    if (response.statusCode == 200) {
      setState(() {
        isSpin = false;
      });
      Navigator.pushNamed(context, Forget_Password_Dialogue.idScreen);
    } else {
      setState(() {
        isSpin = false;
      });
      Fluttertoast.showToast(
          msg: "Something went wrong. (Error: ${response.statusCode})");
    }

    // If the Response Message is Matched.
    // if (jsonDecode(response.body)['msg'] == 'Login Matched') {}
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        iconTheme: IconThemeData(color: Color(0xffdd312d)),
        elevation: 0,
        titleSpacing: 0,
        leading: GestureDetector(
          onTap: () {
            Navigator.pop(context);
          },
          child: Icon(Icons.arrow_back),
        ),
        backgroundColor: const Color(0xfff7f9fc),
        centerTitle: true,
      ),
      backgroundColor: const Color(0xfff7f9fc),
      body: isSpin
          ? Center(
              child: CupertinoActivityIndicator(
                animating: isSpin,
                radius: 15,
              ),
            )
          : Container(
              constraints:
                  BoxConstraints(minHeight: MediaQuery.of(context).size.height),
              child: Center(
                child: SingleChildScrollView(
                  child: Padding(
                    padding: const EdgeInsets.only(
                      left: 50.0,
                      right: 50.0,
                    ),
                    child: Column(
                      children: [
                        Text(
                          'Forgot Password',
                          style: TextStyle(
                            fontFamily: 'Poppins',
                            fontSize: 20,
                            color: const Color(0xffdd312d),
                            fontWeight: FontWeight.w500,
                            height: 1.5,
                          ),
                          textHeightBehavior: TextHeightBehavior(
                              applyHeightToFirstAscent: false),
                          textAlign: TextAlign.left,
                        ),
                        Padding(
                          padding: const EdgeInsets.only(
                            top: 20,
                          ),
                          child: Image(
                              image: AssetImage(
                                  "assets/images/forgotPassImg.PNG")),
                        ),
                        Padding(
                          padding: const EdgeInsets.only(top: 35),
                          child: Container(
                            decoration: BoxDecoration(
                              borderRadius: BorderRadius.circular(5.0),
                              color: const Color(0xffffffff),
                            ),
                            child: TextField(
                              onChanged: (value) {
                                setState(() {
                                  email = value;
                                });
                              },
                              keyboardType: TextInputType.emailAddress,
                              decoration: InputDecoration(
                                border: InputBorder.none,
                                hintText: 'Email ID',
                                hintStyle: TextStyle(
                                  fontFamily: 'Poppins',
                                  fontSize: 12,
                                  color: const Color(0x99444444),
                                  fontWeight: FontWeight.w300,
                                ),
                                prefixIcon: Padding(
                                  padding: const EdgeInsets.only(
                                    bottom: 5,
                                  ),
                                  child: Icon(
                                    Icons.email,
                                    color: Color(0xff444444),
                                  ),
                                ),
                              ),
                            ),
                          ),
                        ),
                        Padding(
                          padding: const EdgeInsets.only(
                            top: 50,
                          ),
                          child: ConstrainedBox(
                            constraints: BoxConstraints(
                              minWidth: MediaQuery.of(context).size.width,
                              minHeight: 50,
                            ),
                            child: Container(
                              child: ElevatedButton(
                                style: ElevatedButton.styleFrom(
                                  side: BorderSide(
                                      width: 1.0,
                                      color: const Color(0xffdd312d)),
                                  elevation: 10.0,
                                  primary: const Color(0xffdd312d),
                                  shape: RoundedRectangleBorder(
                                    borderRadius: BorderRadius.circular(8.0),
                                  ),
                                ),
                                onPressed: () {
                                  if (email == "" || email.trim() == "") {
                                    Fluttertoast.showToast(
                                        msg: "Please enter the email id");
                                  } else {
                                    forgotPassword();
                                  }
                                },
                                child: Text(
                                  "Next",
                                  style: TextStyle(
                                    fontFamily: 'Poppins',
                                    fontSize: 14,
                                    color: const Color(0xfff7f9fc),
                                    letterSpacing: 0.7000000000000001,
                                  ),
                                ),
                              ),
                            ),
                          ),
                        ),
                      ],
                    ),
                  ),
                ),
              ),
            ),
    );
  }
}

